class Solution1:
    def largestComponentSize1(self, A):
        N = len(A)
        print(N)
        def findAllFactor(n):
            if 1 == n:
                return [1]
            cur = n
            res = []
            i = 2
            while cur > 1 and i*i <= cur:
                if 0 == cur % i:
                    res.append(i)
                    while 0 == cur % i:
                        cur = cur // i
                i += 1
            if cur > 1:
                res.append(cur)
            return res
        def findExistFactorInList(a, l):
            res = []
            for idx, ll in enumerate(l):
                for e in ll:
                    if 0 == a % e and 1 != e:
                        res.append(idx)
                        break
            return res
        def updateFactorList(a, l):
            l1 = findAllFactor(a)
            for e in l1:
                if e not in l:
                    l.append(e)

        nodeNumList =[1]
        nodeFactor = [findAllFactor(A[0])]
        for i in range(1,N):
            idxs = findExistFactorInList(A[i], nodeFactor)
            if 0 == len(idxs):
                nodeNumList.append(1)
                nodeFactor.append(findAllFactor(A[i]))
            elif 1 == len(idxs):
                nodeNumList[idxs[0]] += 1
                updateFactorList(A[i], nodeFactor[idxs[0]])
            else:
                nodeNumList[idxs[0]] += 1
                for idx in idxs[:0:-1]:
                    nodeFactor[idxs[0]] += nodeFactor[idx]
                    nodeNumList[idxs[0]] += nodeNumList[idx]
                    del(nodeFactor[idx])
                    del(nodeNumList[idx])
                updateFactorList(A[i], nodeFactor[idxs[0]])
        print(nodeNumList)
        print(nodeFactor)
        return max(nodeNumList)

    def __init__(self):
        def getAllPrime(N):
            resD = [[0,0]]+[[i,1] for i in range(1,N)]
            idx  = 2
            while idx*idx < N:
                if 1 == resD[idx][1]:
                    #interval = resD[idx][0]
                    cur = idx * 2
                    while cur < N:
                        # print(cur)
                        resD[cur][1] = 0
                        cur += idx #interval
                idx += 1
            return [e[0] for e in resD if 1 == e[1]]
        self.primeList = getAllPrime(100000)
    def largestComponentSize2(self, A):
        aaa = 0
        def isDivisible(group, prime):
            for e in group:
                if e >= prime and 0 == e % prime:
                    return True
            return False

        def mergeGroup(idxList):
            if len(idxList) <= 1:
                return
            for idx in idxList[:0:-1]:
                groupList[idxList[0]] += groupList[idx]
                del (groupList[idx])

        groupList = [[i] for i in A]
        maxA = max(A)
        for prime in self.primeList[1:]:
            idxList = []
            if prime > maxA/2:
                break
            for i, group in enumerate(groupList):
                aaa += 1
                if isDivisible(group, prime):
                    idxList.append(i)
            mergeGroup(idxList)
        maxGroupNum = 0
        for group in groupList:
            maxGroupNum = max(len(group), maxGroupNum)
        return maxGroupNum,aaa

